Next, create a new middleware that will handle the anonymous authentication:
// app/Http/Middleware/AuthenticateGuest.php
namespace App\Http\Middleware;
use Closure;
use Firebase\JWT\JWT;
use Illuminate\Support\Facades\Auth;
class AuthenticateGuest
    public function handle(Request $request, Closure $next)
        // Check if the user is already authenticated
        if (Auth::check()) {
            return $next($request);
        // Generate a new JWT token for the guest user
        $token = JWT::encode([
            'iss' => 'your-app-id',
            'aud' => 'https://identitytoolkit.googleapis.com/google.identity.identitytoolkit.v1.IdentityToolkit',
            'iat' => time(),
            'exp' => time() + 3600, // expires in 1 hour
            'uid' => str_random(32), // generate a random user ID
        ], env('FIREBASE_SECRET_KEY'), 'HS256');
        // Set the token in the request headers
        $request->headers->set('Authorization', 'Bearer ' . $token);
        // Authenticate the user with Firebase using the token
        $response = Http::post('https://identitytoolkit.googleapis.com/v1/accounts:signInWithIdp?key=' . env('FIREBASE_API_KEY'), [
            'postBody' => 'id_token=' . $token . '&providerId=firebase',
        ]);
        // Get the user's ID token from the response
        $idToken = $response->json()['idToken'];
        // Set the user's ID token in the session
        session(['id_token' => $idToken]);
        // Return the next middleware in the stack
        return $next($request);
